import React from "react";
import { Link } from "react-router-dom";
import "../css/classList.css";
import codeImage from "../images/codeImg.png";

const ClassListNavigation = () => {
  const roomsDict = {
    1: "*Closing parenthesis ðŸ’¯",
    2: "*Components-react ðŸ’¯",
    3: "*Loop ðŸ’¯",
    4: "*Object+Array ðŸ’¯",
  };

  return (
    <div className="classList">
      <ul className="codeList">
        {Object.entries(roomsDict).map(([key, val]) => {
          return (
            <li>
              <Link to={`/code-block-${key}`}>{val}</Link>
            </li>
          );
        })}
      </ul>
      <img src={codeImage} alt="Footer Image" />
    </div>
  );
};

export default ClassListNavigation;
